import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1 className="text-3xl font-bold mb-6">Meeting Scheduler</h1>
      </header>
      <main className="App-main">
        <div className="flex flex-col items-center">
